import React, { Fragment } from "react";
import PropTypes from "prop-types";

const DropdownMenuComponent = props => {
  const {
    d_tag,
    d_tabIndex,
    d_role,
    d_attributes,
    d_aria,
    d_classes,
    d_key,
    children
  } = props;
  const Tag = d_tag;

  return (
    <Fragment>
      <Tag
        tabIndex={d_tabIndex}
        role={d_role}
        {...d_attributes}
        aria-hidden={d_aria}
        className={d_classes}
        key={d_key}
      >
        {children}
      </Tag>
    </Fragment>
  );
};

DropdownMenuComponent.propTypes = {
  d_aria: PropTypes.bool.isRequired,
  d_attributes: PropTypes.object.isRequired,
  d_key: PropTypes.string.isRequired,
  d_role: PropTypes.string.isRequired,
  d_tabIndex: PropTypes.string.isRequired,
  d_tag: PropTypes.any.isRequired,
  children: PropTypes.node.isRequired,
  d_classes: PropTypes.string
};

DropdownMenuComponent.defaultProps = {
  d_classes: ""
};

export default DropdownMenuComponent;
export { DropdownMenuComponent as MDBDropdownMenuComponent };

import React from "react";
import PropTypes from "prop-types";
import ReactDOM from "react-dom";
import { Manager } from "react-popper";
import classNames from "classnames";
import { omit, keyCodes } from "./utils";

class Dropdown extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isOpen: false
    };

    this.addEvents = this.addEvents.bind(this);
    this.handleDocumentClick = this.handleDocumentClick.bind(this);
    this.handleKeyDown = this.handleKeyDown.bind(this);
    this.removeEvents = this.removeEvents.bind(this);
  }

  getChildContext() {
    return {
      isOpen: this.state.isOpen,
      dropup: this.props.dropup,
      toggle: this.toggle
    };
  }

  componentDidMount() {
    this.handleEventsBinding();
  }

  componentWillUnmount() {
    this.removeEvents();
  }

  componentDidUpdate() {
    this.handleEventsBinding();
  }

  handleEventsBinding() {
    if (this.state.isOpen) {
      this.addEvents();
    } else {
      this.removeEvents();
    }
  }

  getContainer() {
    return ReactDOM.findDOMNode(this);
  }

  addEvents() {
    ["click", "touchstart", "keyup"].forEach(event =>
      document.addEventListener(event, this.handleDocumentClick, true)
    );
  }

  removeEvents() {
    ["click", "touchstart", "keyup"].forEach(event =>
      document.removeEventListener(event, this.handleDocumentClick, true)
    );
  }

