      responsiveLg,
      responsiveXl,
      searching,
      searchLabel,
      scrollX,
      scrollY,
      small,
      sortable,
      striped,
      tbodyColor,
      tbodyTextWhite,
      theadColor,
      theadTextWhite,
      ...attributes
    } = this.props;

    const {
      columns,
      entries,
      filteredRows,
      pages,
      activePage,
      search,
      translateScrollHead
    } = this.state;

    const entriesArr = [10, 25, 50, 100];

    let ExportToCsvBtn;
    if (exportToCSV) {
      try {
        ExportToCsvBtn = require("./pro/ExportToCSV").default;
      } catch (err) {
        console.log(
          "Export to CSV is MDB PRO component, more here: https://mdbootstrap.com/products/react-ui-kit/"
        );
      }
    }

    return (
      <div className="dataTables_wrapper dt-bootstrap4">
        <div className="row">
          <DataTableEntries
            paging={paging}
            entries={entries}
            handleEntriesChange={this.handleEntriesChange}
            entriesArr={entriesArr}
            label={entriesLabel}
          />
          <DataTableSearch
            handleSearchChange={this.handleSearchChange}
            search={search}
