import React from "react";
import PropTypes from "prop-types";
import classNames from "classnames";
import { omit } from "./utils";

const propTypes = {
  children: PropTypes.node,
  active: PropTypes.bool,
  disabled: PropTypes.bool,
  divider: PropTypes.bool,
  tag: PropTypes.oneOfType([PropTypes.func, PropTypes.string]),
  header: PropTypes.bool,
  onClick: PropTypes.func,
  className: PropTypes.string,
  toggle: PropTypes.bool
};

const contextTypes = {
  toggle: PropTypes.func
};

const defaultProps = {
  tag: "button",
  toggle: true
};

class DropdownItem extends React.Component {
  constructor(props) {
    super(props);

    this.onClick = this.onClick.bind(this);
    this.getTabIndex = this.getTabIndex.bind(this);
  }

  onClick(e) {
    if (this.props.disabled || this.props.header || this.props.divider) {
      e.preventDefault();
      return;
    }

    if (this.props.onClick) {
      this.props.onClick(e);
    }

    if (this.props.toggle) {
      this.context.toggle(e);
    }
  }

  getTabIndex() {
    if (this.props.disabled || this.props.header || this.props.divider) {
      return "-1";
    }

    return "0";
  }

  render() {
    const tabIndex = this.getTabIndex();
    let { className, divider, tag: Tag, header, active, ...props } = omit(
      this.props,
      ["toggle"]
    );

    const classes = classNames(
      {
        disabled: props.disabled,
        "dropdown-item": !divider && !header,
        active: active,
        "dropdown-header": header,
        "dropdown-divider": divider
      },
      className
    );

    if (Tag === "button") {
      if (header) {
        Tag = "h6";
      } else if (divider) {
        Tag = "div";
      } else if (props.href) {
        Tag = "a";
      }
    }

    return (
      <Tag
        type={
          Tag === "button" && (props.onClick || this.props.toggle)
            ? "button"
            : undefined
        }
        {...props}
        tabIndex={tabIndex}
        className={classes}
        onClick={this.onClick}
      />
    );
  }
}

DropdownItem.propTypes = propTypes;
DropdownItem.defaultProps = defaultProps;
DropdownItem.contextTypes = contextTypes;

export default DropdownItem;
export { DropdownItem as MDBDropdownItem };

import React, { Component } from "react";
import PropTypes from "prop-types";
import classNames from "classnames";
import { Popper } from "react-popper";
import "./DropdownMenu.css";
let DropdownMenuComponent;
try {
  DropdownMenuComponent = require("./pro/DropdownMenuProComponent").default;
} catch (err) {
  DropdownMenuComponent = require("./DropdownMenuComponent").default;
}

const noFlipModifier = { flip: { enabled: false } };

class DropdownMenu extends Component {
  render() {
    const {
      basic,
      className,
      right,
      children,
      tag,
      flip,
      color,
      ...attrs
    } = this.props;

    const classes = classNames(
      "dropdown-menu",
      color && `dropdown-${color}`,
      {
        "dropdown-menu-right": right,
        show: this.context.isOpen,
        basic: basic
      },
      className
    );

    let Tag = tag;

    if (this.context.isOpen) {
      Tag = Popper;
      const position1 = this.context.dropup ? "top" : "bottom";
      const position2 = right ? "end" : "start";
      attrs.placement = `${position1}-${position2}`;
      attrs.component = tag;
      attrs.modifiers = !flip ? noFlipModifier : undefined;
    }

    return (
      <DropdownMenuComponent
        isOpen={this.context.isOpen}
        d_tag={Tag}
        d_tabIndex="-1"
        d_role="menu"
        d_attributes={attrs}
        d_aria={!this.context.isOpen}
        d_classes={classes}
        d_key="dropDownMenu"
      >
        {children}
      </DropdownMenuComponent>
    );
  }
}

DropdownMenu.propTypes = {
  children: PropTypes.node.isRequired,
  basic: PropTypes.bool,
  className: PropTypes.string,
  flip: PropTypes.bool,
  right: PropTypes.bool,
  tag: PropTypes.string
};

DropdownMenu.defaultProps = {
  basic: false,
  className: "",
  flip: false,
  right: false,
  tag: "div",
  color: false
};

DropdownMenu.contextTypes = {
  isOpen: PropTypes.bool.isRequired,
  dropup: PropTypes.bool.isRequired,
  color: PropTypes.oneOfType([
    PropTypes.oneOf(['primary', 'default', "secondary", "success", "dark", "danger", "info", "warning", "ins" ]),
    PropTypes.bool])

};

export default DropdownMenu;
export { DropdownMenu as MDBDropdownMenu };

import React from "react";
import PropTypes from "prop-types";
import classNames from "classnames";
import { Target } from "react-popper";
import Button from "./Button";

class DropdownToggle extends React.Component {
  constructor(props) {
    super(props);

    this.onClick = this.onClick.bind(this);
  }

  onClick(e) {
    if (this.props.disabled) {
      e.preventDefault();
      return;
    }

    if (this.props.nav && !this.props.tag) {
      e.preventDefault();
    }

    if (this.props.onClick) {
      this.props.onClick(e);
    }

    this.context.toggle(e);
  }

  render() {
    const { className, color, caret, split, nav, tag, ...props } = this.props;
    const ariaLabel = props["aria-label"] || "Toggle Dropdown";
    const classes = classNames(
      {
        "dropdown-toggle": caret || split,
        "dropdown-toggle-split": split,
        "nav-link": nav
      },
      className
    );
    const children = props.children || (
      <span className="sr-only">{ariaLabel}</span>
    );

    let Tag;

    if (nav && !tag) {
      Tag = "a";
      props.href = "#";
    } else if (!tag) {
      Tag = Button;
      props.color = color;
    } else {
      Tag = tag;
    }

    return (
      <Target
        {...props}
        className={classes}
        component={Tag}
        onClick={this.onClick}
        aria-expanded={this.context.isOpen}
      >
        {children}
      </Target>
    );
  }
}

DropdownToggle.propTypes = {
  caret: PropTypes.bool,
  color: PropTypes.string,
  children: PropTypes.node,
  className: PropTypes.string,
  disabled: PropTypes.bool,
  onClick: PropTypes.func,
  "aria-haspopup": PropTypes.bool,
  split: PropTypes.bool,
  tag: PropTypes.oneOfType([PropTypes.func, PropTypes.string]),
  nav: PropTypes.bool
};

DropdownToggle.defaultProps = {
  "aria-haspopup": true,
  color: "secondary"
};

DropdownToggle.contextTypes = {
  isOpen: PropTypes.bool.isRequired,
  toggle: PropTypes.func.isRequired
};

export default DropdownToggle;
export { DropdownToggle as MDBDropdownToggle };

